import { Link } from 'react-router-dom'
import {useState} from 'react';
import Straydog from '../compoenents/straydog/Straydog'

const Main = () => {
    const [page, setPage] = useState(0);
    const content = <h1>HI</h1>
    if(page === 1) {
        content = <Straydog />
    }
    return (
        <div>
            <h1>홈</h1>
            <p>메인 페이지입니다.</p>
            <Link to ="/aboutus">소개</Link>
            <br/>
            <Link to ="/main/straydog" onClick={() => {
                setPage(1)
            }}>택우</Link>
            <Link to ="/stray-dog-guide">진솔</Link>
            <Link to ="/stray-dog-">재명</Link>
            <Link to ="">민규</Link>
            <Link to ="">우진</Link>
            <Link to ="">연주</Link>
            <Link to ="">예지</Link>
            <Link to ="">정원</Link>
            <Link to ="">수원</Link>
            <Link to ="">태원</Link>
            <hr/>
            {content}
            
        </div>
        
    );
};

export default Main;
